o: Lorem Ipsum pochodzi z fragmentów (1.10.32 i 1.10.33) „de Finibus Bonorum et Malorum”, czyli „O granicy dobra i zła”, napisanej właśnie w 45 p.n.e. przez Cycerona. Jest to bardzo popularna w czasach renesansu rozprawa na temat etyki. Pierwszy wiersz Lorem Ipsum, „Lorem ipsum dolor sit amet...” pochodzi właśnie z sekcji 1.10.32.[/vc_column_text][/vc_column][/vc_row][vc_row][vc_column][/vc_column][/vc_row]', 'Tytuł aktualności 1', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Fusce vitae mauris nullam sit amet quam eu dui ornare iaculis. Donec ultrices leo ac nulla. Vestibulum ante ipsum primis in faucibus orci luctus et ultrices.', 'inherit', 'closed', 'closed', '', '1018-revision-v1', '', '', '2018-02-01 11:29:42', '2018-02-01 10:29:42', '', 1018, 'http://192.168.1.42/beauty/2018/02/01/1018-revision-v1/', 0, 'revision', '', 0);
