(1113, 1, '2018-02-06 10:12:55', '2018-02-06 09:12:55', '<strong>Mikrodermabrazja</strong> jest nowoczesną metodą peelingu mechanicznego. jest zabiegiem całkowicie bezpiecznym, który nie narusza struktury skóry właściwej.\r\n\r\nMikrodermabrazja przeprowadzana jest przy użyciu specjalnie do tego celu przystosowanych głowic ścierających, których powierzchnia została pokryta drobinkami naturalnego bądź syntetycznego diamentu. Zabieg jest całkowicie bezbolesny.\r\n\r\n<strong>Wskazania:</strong>\r\n<ul>\r\n 	<li>płytkie zmarszczki;</li>\r\n 	<li>blizny;</li>\r\n 	<li>rozstępy;</li>\r\n 	<li>nadmierne rogowacenie naskórka;</li>\r\n 	<li>zmiany powstałe w wyniku fotostarzenia;</li>\r\n 	<li>brak napięcia i elastyczności skóry;</li>\r\n 	<li>przebarwiania;</li>\r\n 	<li>rogowacenie okołomieszkowe;</li>\r\n 	<li>trądzik pospolity bez stanów zapalnych.</li>\r\n 	<li>zaskórniki</li>\r\n</ul>\r\n<b>Przeciwwskazania</b><strong>:</strong>\r\n<ul>\r\n 	<li>zakażenia grzybicze;</li>\r\n 	<li>zakażenia wirusowe – brodawki, opryszczka itd.;</li>\r\n 	<li>zakażenia bakteryjne – liszajec, zapalenie mieszków włosowych;</li>\r\n 	<li>nowotwory skóry;</li>\r\n 	<li>znamiona;</li>\r\n 	<li>trądzik różowaty i grudkowo-krostkowy;</li>\r\n 	<li>uszkodzenia ciągłości skóry;</li>\r\n</ul>\r\nCzas zabiegu: od 30 do 60 min\r\nPo zabiegu mikrodermabrazji należy unikać opalania przez co najmniej 2 tygodnie, a także sauny i basenu przez co najmniej tydzień.', 'Mikrodermabrazja', '', 'publish', 'closed', 'closed', '', 'mikrodermabrazja', '', '', '2018-02-06 10:12:55', '2018-02-06 09:12:55', '', 984, 'http://192.168.1.42/beauty/?page_id=1113', 0, 'page', '', 0),
