(1116, 1, '2018-02-06 10:27:57', '2018-02-06 09:27:57', '<strong>Peeling kawitacyjny</strong> to innowacyjna i komfortowa metoda oczyszczania skóry za pomocą wibracji ultradźwiękowej, wzbogacona o mikromasaż, który poprawia mikrokrążenie i dotlenienie komórkowe oraz zwiększa penetrację substancji aktywnych w głąb skóry. Kawitacja zapewnia dokładne oczyszczenie skóry z zalegającej warstwy zrogowaciałego naskórka, toksyn oraz wydzielin gruczołów łojowych, a przy tym jest to zabieg całkowicie bezbolesny.\r\n\r\n<strong>Wskazania:</strong>\r\n<ul>\r\n 	<li>trądzik pospolity i różowaty;</li>\r\n 	<li>zaskórniki;</li>\r\n 	<li>wągry;</li>\r\n 	<li>rozszerzone pory;</li>\r\n 	<li>przetłuszczająca się skóra;</li>\r\n 	<li>niejednolity koloryt,</li>\r\n 	<li>skóra wymagające regeneracji</li>\r\n</ul>\r\n<b>Przeciwwskazania:</b>\r\n<ul>\r\n 	<li>nowotwory</li>\r\n 	<li>ciąża</li>\r\n 	<li>ostre/ropne stany zapalne skóry</li>\r\n 	<li>ciężka niewydolność krążenia</li>\r\n 	<li>obecność w ciele części metalowych (np.: rozrusznik serca, aparat na zębach)</li>\r\n</ul>\r\nCzas zabiegu: od 30 do 45 min.', 'Peeling kawitacyjny', '', 'publish', 'closed', 'closed', '', 'peeling-kawitacyjny', '', '', '2018-02-06 10:27:57', '2018-02-06 09:27:57', '', 984, 'http://192.168.1.42/beauty/?page_id=1116', 0, 'page', '', 0),
