(1121, 1, '2018-02-06 10:53:58', '2018-02-06 09:53:58', 'Jeśli liczysz na profesjonalną pomoc w oczyszczeniu Twojej cery z widocznych zaskórników i borykasz się z problemem rozszerzonych porów, możesz skorzystać z zabiegu oczyszczania manualnego. Zabieg łączy aktywność składników o działaniu przeciwbakteryjnym, łagodzącym i ściągającym z klasyczną techniką ręcznego usuwania zaskórników.\r\n\r\n<strong>Wskazania:</strong>\r\n<ul>\r\n 	<li>• skóra zanieczyszczona, trądzik zaskórnikowy</li>\r\n</ul>\r\n<strong>Przeciwwskazania:</strong>\r\n<ul>\r\n 	<li>duża ilość stanów zapalnych;</li>\r\n 	<li>opryszczka;</li>\r\n 	<li>stany alergiczne;</li>\r\n 	<li>tendencja do powstawania blizn;</li>\r\n 	<li>trądzik różowaty;</li>\r\n 	<li>skóra naczyniowa</li>\r\n</ul>\r\nCzas trwania: od 60 do 90 min.', 'Oczyszczanie manualne', '', 'publish', 'closed', 'closed', '', 'oczyszczanie-manualne', '', '', '2018-02-06 10:53:58', '2018-02-06 09:53:58', '', 984, 'http://192.168.1.42/beauty/?page_id=1121', 0, 'page', '', 0),
