(1130, 1, '2018-02-06 11:00:20', '2018-02-06 10:00:20', 'Zabieg przeznaczony dla osób ze skórą szarą, zmęczoną, źle odżywioną, zwiotczałą, niedotlenioną, pozbawioną elastyczności, jędrności i blasku. Szczególnie polecany osobom żyjącym w ciągłym stresie i przemęczeniu. Zalecany jest również profilaktycznie osobom chcącym jak najdłużej cieszyć się młodością swojej skóry.\r\n\r\n<strong>Przeciwwskazania:</strong>\r\n<ul>\r\n 	<li>przerwanie ciągłości tkanek w miejscu zabiegu,</li>\r\n 	<li>mikro razy,</li>\r\n 	<li>zabiegi chirurgiczne w obrębie twarzy (do 2 miesięcy),</li>\r\n 	<li>infekcje bakteryjne i wirusowe,</li>\r\n 	<li>choroby skóry,</li>\r\n 	<li>zakażenia skóry,</li>\r\n 	<li>stany gorączkowe,</li>\r\n 	<li>choroby zakaźne</li>\r\n</ul>\r\nCzas trwania: od 30 do 45 min.', 'Masaż twarzy, szyi i dekoltu', '', 'publish', 'closed', 'closed', '', 'masaz-twarzy-szyi-i-dekoltu', '', '', '2018-02-06 11:00:20', '2018-02-06 10:00:20', '', 984, 'http://192.168.1.42/beauty/?page_id=1130', 0, 'page', '', 0),
