(1134, 1, '2018-02-06 12:07:44', '2018-02-06 11:07:44', 'Niezwykle skuteczny zabieg poprawiający wygląd i kondycję skóry. Oparty na bezbolesnej, nieinwazyjnej i bezpiecznej metodzie, złuszczania, czyli usuwania suchej, zrogowaciałej warstwy naskórka. Prowadzi do głębokiego oczyszczenia i odblokowania porów skóry, jej rewitalizacji, odświeżenia i rozjaśnienia. Rodzaj kwasu dobierany indywidualnie do potrzeb skóry.\r\n\r\n<strong>Wskazania:</strong>\r\n<ul>\r\n 	<li>Przebarwienia</li>\r\n 	<li>Zaskórniki, rozszerzone pory</li>\r\n 	<li>Nierówny koloryt</li>\r\n 	<li>Skóra przetłuszczająca się</li>\r\n 	<li>Blizny potrądzikowe</li>\r\n 	<li>Skóra sucha, pozbawiona blasku</li>\r\n 	<li>Drobne zmarszczki</li>\r\n</ul>\r\n<strong>Przeciwwskazania:</strong>\r\n<ul>\r\n 	<li>stany zapalnie</li>\r\n 	<li>stany zakaźne</li>\r\n 	<li>stany alergiczne</li>\r\n 	<li>zakażenie bateryjne</li>\r\n 	<li>zakażenie wirusowe</li>\r\n 	<li>stosowanie retinoidów(pochodnej wit A)</li>\r\n 	<li>świeże rany, blizny, otarcia, oparzenia</li>\r\n 	<li>ciąża</li>\r\n 	<li>skłonność do powstawania bliznowców</li>\r\n</ul>\r\nPo zabiegu złuszczania kwasami należy unikać ekspozycji na słońce oraz basenu i sauny przez 2 tygodnie.\r\n\r\nCzas zabiegu: od 30 do 45 min.\r\n\r\n&nbsp;', 'Złuszczanie kwasami', '', 'publish', 'closed', 'closed', '', 'zluszczanie-kwasami', '', '', '2018-02-06 12:07:44', '2018-02-06 11:07:44', '', 984, 'http://192.168.1.42/beauty/?page_id=1134', 0, 'page', '', 0),
