(1137, 1, '2018-02-06 12:10:39', '2018-02-06 11:10:39', 'Rewolucyjny zabieg firmowy, witaminowy peeling, który już po jednokrotnym zastosowaniu, znacząco poprawia kondycję skóry. Preparat poza zawartością witaminy C zawiera kwasy AHA, komórki macierzyste Wąkroty Azjatyckiej i enzymy proteolityczne pochodzenia roślinnego, dzięki czemu gwarantuje delikatną eksfoliacją, połączoną z lekko rozjaśniającym działaniem. Największą zaletą peelingu jest jego stymulujący wpływ na produkcję kolagenu, wzmocnienie i usprawnienie mikrocyrkulacji w naczyniach włosowatych skóry. Zawarty kwas hialuronowy, nawilżające polipeptydy i wyciągi roślinne zapewniają silne działanie antyoksydacyjne.\r\n\r\nCzas zabiegu: 45 min', 'Zabieg Signature Facelift Image SkinCare', '', 'publish', 'closed', 'closed', '', 'zabieg-signature-facelift-image-skincare', '', '', '2018-02-06 12:10:39', '2018-02-06 11:10:39', '', 984, 'http://192.168.1.42/beauty/?page_id=1137', 0, 'page', '', 0),
