(1140, 1, '2018-02-06 12:25:43', '2018-02-06 11:25:43', 'Zabieg eksfoliacyjny, przeznaczony do przeprowadzania kuracji redukującej przebarwienia pigmentacyjne. Formuła peelingu opiera się na roztworze kwasu mlekowego, komórek macierzystych Undari Pierzastodzielnej i Jeżówki Waskolistnej i zawartości substancji rozjaśniających, powodujących inhibicję tyrozynazy, dzięki czemu hamują nadmierną melanogenezę. Kwas mlekowy połączony z koktajlem czynników rozjaśniających, skutecznie redukują wszelkie przebarwienia, odświeżają koloryt i nawilżają.\r\n\r\nCzas zabiegu: 45 min.', 'Zabieg Lightening Lift Image SkinCare', '', 'publish', 'closed', 'closed', '', 'zabieg-lightening-lift-image-skincare', '', '', '2018-02-06 12:25:43', '2018-02-06 11:25:43', '', 984, 'http://192.168.1.42/beauty/?page_id=1140', 0, 'page', '', 0),
