(1143, 1, '2018-02-06 12:44:44', '2018-02-06 11:44:44', '<strong>Specjalistyczny, kompleksowy</strong> <span style=\"text-decoration: underline;\"><strong>zabieg dermo-liftingujący</strong></span> zainspirowany efektami prestiżowych zabiegów z zakresu medycyny estetycznej. Głównym jego zadaniem jest wygładzenie skóry i poprawa jędrności, a także regeneracja skóry i podtrzymanie efektów po zabiegach dermo kosmetycznych. Opracowany z myślą o kobietach około 40 r. ż., które pragną efektywnej i szybkiej poprawy stanu skóry. Jego tajemnica tkwi w zastosowaniu kombinacji najbardziej zaawansowanych technologicznie składników najnowszej generacji o szerokim i udowodnionym działaniu opóźniającym starzenie się skóry.\r\n\r\nCzas zabiegu: 75 min', 'Zabieg Neurolift Farmona', '', 'publish', 'closed', 'closed', '', 'zabieg-neurolift-farmona', '', '', '2018-02-06 12:44:44', '2018-02-06 11:44:44', '', 984, 'http://192.168.1.42/beauty/?page_id=1143', 0, 'page', '', 0),
