(1146, 1, '2018-02-06 12:55:20', '2018-02-06 11:55:20', 'Wyjątkowy, autorski zabieg kosmetyczny stworzony dla cery dojrzałej o silnym działaniu regenerującym i ujędrniającym, łączący niezwykłe właściwości Soku Smocza Krewa (Dragon’s blood) z aktywnym Bio - krzemem. Unikalne połączenie składników aktywnych sprawia, że natychmiast po zabiegu skóra wygląda na młodszą, wypoczętą i zdrowszą.\r\n\r\nCzas zabiegu: 75 min.', 'Zabieg Skalpel Farmona', '', 'publish', 'closed', 'closed', '', 'zabieg-skalpel-farmona', '', '', '2018-02-06 12:55:20', '2018-02-06 11:55:20', '', 984, 'http://192.168.1.42/beauty/?page_id=1146', 0, 'page', '', 0),
