(1149, 1, '2018-02-06 12:59:58', '2018-02-06 11:59:58', 'Intensywnie nawilżający zabieg przeznaczony do każdego typu cery, w szczególności odwodnionej, przesuszonej słońcem lub opalaniem w solarium oraz odwodnionej na skutek suchego powietrza(klimatyzacja, ogrzewanie w okresie jesienno-zimowym). Wyjątkowe, synergiczne połączenie innowacyjnych, inteligentnych składników aktywnych radykalnie i długotrwale zwiększa nawilżenie skóry, zapewniającej jej jędrność i witalność.\r\n\r\nCzas zabiegu: 75 min.', 'Zabieg Hydra Quest Farmona', '', 'publish', 'closed', 'closed', '', 'zabieg-hydra-quest-farmona', '', '', '2018-02-06 12:59:58', '2018-02-06 11:59:58', '', 984, 'http://192.168.1.42/beauty/?page_id=1149', 0, 'page', '', 0),
