(1151, 1, '2018-02-06 13:04:00', '2018-02-06 12:04:00', 'Nasza skóra codziennie narażona jest na działanie wielu niekorzystnych czynników takich jak – zanieczyszczenia środowiska, klimatyzowane pomieszczenia, stres, promieniowanie UV, dym papierosowy. Idealną odpowiedzią na jej potrzeby jest kompleksowy zabieg ANTI POLLUTION, wykorzystujący najnowsze odkrycia kosmetologii. Podstawą zabiegu jest innowacyjne połączenie składników aktywnych, które dotleniają, odświeżają i chronią skórę przed przedwczesnym starzeniem.\r\n\r\nCzas zabiegu : 75 min.', 'Zabieg Anti Pollution Farmona', '', 'publish', 'closed', 'closed', '', 'zabieg-anti-pollution-farmona', '', '', '2018-02-06 13:04:00', '2018-02-06 12:04:00', '', 984, 'http://192.168.1.42/beauty/?page_id=1151', 0, 'page', '', 0),
