(1154, 1, '2018-02-06 13:10:17', '2018-02-06 12:10:17', 'Styl życia, praca, nauka, duża ilość obowiązków sprawiają, że nasz organizm potrzebuje coraz więcej energii. Najefektywniejszym „paliwem” dla naszego organizmu jest cukier. Niestety cukier ma nie tylko wpływ na naszą sylwetkę, ale również na kondycję i wygląd skóry. Proces glikacji stopniowo uszkadza strukturę skóry, czego rezultatem jest utrata elastyczności i sprężystości, pojawiają się powierzchniowe zmarszczki, zmienia się koloryt cery – skóra staje się bardziej żółta.\r\n\r\nZabieg antyglikacyjny ma za zadanie odwrócić skutki wynikające z procesu glikacji - zmniejszyć ilość akumulowanych A.G.E. i degradacji GAGów. Przywraca elastyczność włóknom białkowym, poprawia właściwości biomechaniczne i widocznie odmładza skórę.\r\n\r\nCzas zabiegu : 75 min.', 'Zabieg Anti A.G.E. Farmona', '', 'publish', 'closed', 'closed', '', 'zabieg-anti-a-g-e-farmona', '', '', '2018-02-06 13:10:17', '2018-02-06 12:10:17', '', 984, 'http://192.168.1.42/beauty/?page_id=1154', 0, 'page', '', 0),
(1155, 1, '2018-02-06 13:10:17', '2018-02-06 12:10:17', 'Styl życia, praca, nauka, duża ilość obowiązków sprawiają, że nasz organizm potrzebuje coraz więcej energii. Najefektywniejszym „paliwem” dla naszego organizmu jest cukier. Niestety cukier ma nie tylko wpływ na naszą sylwetkę, ale również na kondycję i wygląd skóry. Proces glikacji stopniowo uszkadza strukturę skóry, czego rezultatem jest utrata elastyczności i sprężystości, pojawiają się powierzchniowe zmarszczki, zmienia się koloryt cery – skóra staje się bardziej żółta.\r\n\r\nZabieg antyglikacyjny ma za zadanie odwrócić skutki wynikające z procesu glikacji - zmniejszyć ilość akumulowanych A.G.E. i degradacji GAGów. Przywraca elastyczność włóknom białkowym, poprawia właściwości biomechaniczne i widocznie odmładza skórę.\r\n\r\nCzas zabiegu : 75 min.', 'Zabieg Anti A.G.E. Farmona', '', 'inherit', 'closed', 'closed', '', '1154-revision-v1', '', '', '2018-02-06 13:10:17', '2018-02-06 12:10:17', '', 1154, 'http://192.168.1.42/beauty/2018/02/06/1154-revision-v1/', 0, 'revision', '', 0),
(1156, 1, '2018-02-06 13:12:09', '2018-02-06 12:12:09', 'Nasz wygląd w zdecydowanej części zdeterminowany jest przez nasze DNA. Geny, a dokładnie ich aktywność, wpływają na kondycję skóry i na wiek postrzegany, czyli to jak widzą nas inni, pomimo naszego realnego wieku.\r\n\r\nNa wygląd naszego ciała, w szczególności skóry wpływają geny, a dokładnie ich aktywność. Epigenetyka zajmuje się regulacją ekspresji genów aktywowanych przez czynniki środowiskowe – promieniowanie UV, zanieczyszczenia, styl życia), a genokosmetyki są nową generacją produktów, których działanie ukierunkowane jest na źródło zaburzeń skórnych wywołanych przez starzenie. Pozwalają atakować problem u jego źródła, nie tylko tam, gdzie się objawia, ale przed wszystkim tam gdzie on powstaje.\r\n\r\nWraz z wiekiem szybkość degradacji składników skóry jest większa, niż prędkość ich powstawania, która maleje wraz w wiekiem.\r\n\r\nZabieg SKIN GENIC ma za zadanie aktywować i chronić skórę przed zmianami epigenetycznymi i widocznie przedłużać młodość skóry.\r\n\r\nCzas zabiegu: 75 min.', 'Zabieg Skin Genic Farmona', '', 'publish', 'closed', 'closed', '', 'zabieg-skin-genic-farmona', '', '', '2018-02-06 13:12:09', '2018-02-06 12:12:09', '', 984, 'http://192.168.1.42/beauty/?page_id=1156', 0, 'page', '', 0),
