(1158, 1, '2018-02-06 13:17:12', '2018-02-06 12:17:12', 'Mezoterapia mikroigłowa jest to zabieg wykonywany za pomocą specjalnie zaprojektowanego urządzenia MezoPen do frakcyjnych mikronakłuć naskórka i skóry właściwej.\r\n\r\nDzięki systemowi pulsujących igieł ułatwiającemu dostarczanie substancji czynnych do naskórka i skóry właściwej zapewnia stymulację fibroblastów. Powstałe mikrourazy skóry wykorzystują naturalne zdolności organizmu oraz wrodzoną zdolność naprawy skóry do fizjologicznej indukcji kolagenu. Mezoterapia mikroigłowa tworzy w skórze mikrokanaliki, dzięki którym możemy wprowadzić ampułki ze składnikami aktywnymi.\r\n\r\n<strong>Wskazania:</strong>\r\n<ul>\r\n 	<li>Blizny</li>\r\n 	<li>Rozstępy</li>\r\n 	<li>Głębokie i utrwalone zmarszczki</li>\r\n 	<li>Utrata jędrności skóry</li>\r\n 	<li>Przebarwienia i nierówny koloryt</li>\r\n</ul>\r\n<strong>Przeciwwskazania:</strong>\r\n<ul>\r\n 	<li>Stany zapalne skóry</li>\r\n 	<li>Infekcje</li>\r\n 	<li>Alergia na składniki preparatu</li>\r\n 	<li>Wszystkie choroby zakaźne</li>\r\n 	<li>Zakażenia wirusowe: opryszczka, brodawki, mięczak zakaźny</li>\r\n 	<li>Zakażenia grzybicze</li>\r\n 	<li>Zakażenia bakteryjne: liszajec zakaźny</li>\r\n 	<li>Skłonność do keloidów</li>\r\n 	<li>Zmiany ropne na skórze</li>\r\n 	<li>Ciąża i okres laktacji</li>\r\n 	<li>Choroby nowotworowe</li>\r\n 	<li>Zmniejszenie krzepliwości krwi i przyjmowanie leków zmniejszających krzepliwość krwi</li>\r\n</ul>\r\nEfekt zabiegu może być widoczny już po jednym zabiegu ale zaleca się wykonanie serii co najmniej 3 zabiegów w odstępie 2-4 tygodni. Ilość zabiegów zależy od rodzaju i problemów skóry. Pełen efekt widoczny jest w ciągu miesiąca od ostatniego zabiegu.\r\n\r\nCzas rekonwalescencji po nakłuciach trwa zwykle 3 dni.\r\n\r\nCzas zabiegu: 90 min.', 'Mezoterapia mikroigłowa', '', 'publish', 'closed', 'closed', '', 'mezoterapia-mikroiglowa', '', '', '2018-02-06 13:17:12', '2018-02-06 12:17:12', '', 984, 'http://192.168.1.42/beauty/?page_id=1158', 0, 'page', '', 0),
