(1167, 1, '2018-02-06 13:53:22', '2018-02-06 12:53:22', 'Przy opracowywaniu zabiegu wykorzystano rewolucyjne <strong>odkrycie, nagrodzone w 2003 roku Nagrodą Nobla w dziedzinie chemii. Chodzi o zjawisko elektroporacji</strong>, które powoduje reorganizację błon komórkowych i w efekcie – zwiększenie przepuszczalności skóry. To pozwala na bezbolesne wprowadzenie dużej dawki substancji aktywnych o wysokim stężeniu – witamin, składników mineralnych, składników o działaniu nawilżającym, stymulującym, łagodzącym podrażnienia. Składniki takiego koktajlu uwalniają się natychmiastowo, poprawiając kondycję skóry i pozostawiając efekt, który trwa. <strong>Zabieg jest doskonałą alternatywą do metod z zastosowaniem ostrzykiwania czy peelingów medycznych, które wymagają przynajmniej kilku dni na powrót pacjenta do formy i cieszenie się pełnymi efektami</strong>.\r\n\r\n<strong>Zabieg Dermation to aż 9 programów terapeutycznych na twarz i ciało:</strong>\r\n<ul>\r\n 	<li>Silnie nawilżający</li>\r\n 	<li>Ujędrniający</li>\r\n 	<li>Przeciwzmarszczkowy</li>\r\n 	<li>Przeciwtrądzikowy</li>\r\n 	<li>Obkurczający naczynka</li>\r\n 	<li>Wygładzający blizny i rozstępy</li>\r\n 	<li>Rozjaśniający przebarwienia</li>\r\n 	<li>Antycellulitowy</li>\r\n</ul>\r\n<strong>Przeciwwskazania:</strong>\r\n<ul>\r\n 	<li>metalowe elementy w ciele</li>\r\n 	<li>choroby serca</li>\r\n 	<li>rozrusznik serca</li>\r\n 	<li>epilepsja</li>\r\n 	<li>nadwrażliwość skóry</li>\r\n 	<li>stany zapalne skóry</li>\r\n 	<li>alergia na składniki kosmetyków</li>\r\n 	<li>ciąża i okres karmienia</li>\r\n</ul>\r\nCzas trwania: 35 min.', 'Zabieg Dermation', '', 'inherit', 'closed', 'closed', '', '1161-revision-v1', '', '', '2018-02-06 13:53:22', '2018-02-06 12:53:22', '', 1161, 'http://192.168.1.42/beauty/2018/02/06/1161-revision-v1/', 0, 'revision', '', 0),
