(1169, 1, '2018-02-06 14:16:33', '2018-02-06 13:16:33', 'Elektrostymulator za pomocą delikatnych lecz głębokich impulsów elektrycznych stymuluje kompleksowo tkanki powierzchniowe i przenika w głąb skóry. Podczas zabiegu następuje pobudzenie przemiany materii i krążenia krwi, redukcji ulega znaczna ilość podskórnej tkanki tłuszczowej, wzrasta jędrność i elastyczność skóry. Prąd pobudza mięśnie do rytmicznych skurczów porównywalnych z tymi jakie pojawiają się podczas ćwiczeń fizycznych.\r\n\r\n<strong>Wskazania:</strong>\r\n<ul>\r\n 	<li>redukcja tkanki tłuszczowej z najbardziej opornych w terapii obszarów, takich jak: brzuch, uda czy pośladki</li>\r\n 	<li>redukcja wagi</li>\r\n 	<li>wzmocnienie i zwiększenie siły mięśni</li>\r\n 	<li>wyrzeźbienie i wysmuklenie sylwetki</li>\r\n 	<li>redukcja cellulitu i wyrównanie powierzchni skóry</li>\r\n 	<li>poprawa ukrwienia, odżywienia i dotlenienia skóry</li>\r\n 	<li>przyspieszenie produkcji kolagenu i elastyny</li>\r\n 	<li>poprawa elastyczności, napięcia i kolorytu skóry</li>\r\n</ul>\r\n<strong>Przeciwwskazania:</strong>\r\n<ul>\r\n 	<li>wszczepiony rozrusznik serca,</li>\r\n 	<li>metalowe protezy,</li>\r\n 	<li>przy zabiegach na brzuch – wkładka domaciczna,</li>\r\n 	<li>epilepsja (zabieg możliwy wyłącznie pod nadzorem lekarza),</li>\r\n 	<li>niedawno przebyty zabieg chirurgiczny,</li>\r\n 	<li>żylaki – przy zabiegach na nogi,</li>\r\n 	<li>ciąża</li>\r\n</ul>', 'Elektrostymulacja', '', 'publish', 'closed', 'closed', '', 'elektrostymulacja', '', '', '2018-02-06 14:18:12', '2018-02-06 13:18:12', '', 984, 'http://192.168.1.42/beauty/?page_id=1169', 0, 'page', '', 0),
