(1174, 1, '2018-02-06 14:24:23', '2018-02-06 13:24:23', 'Liposukcja ultradźwiękowa jest bezinwazyjnym zabiegiem polegającym na odsysaniu nadmiernie nagromadzonej tkanki tłuszczowej z takich miejsc, jak: biodra, pośladki, uda, brzuch. Liposukcja bez skalpela odbywa się przez zastosowanie ultradźwięków, które rozbijają błony komórkowe komórek tłuszczowych.\r\n\r\n<strong>Przeciwwskazania:</strong>\r\n<ul>\r\n 	<li>ciąża i okres laktacji</li>\r\n 	<li>nieunormowane ciśnienie tętnicze</li>\r\n 	<li>choroby nowotworowe przed upływem 5 lat od ich wyleczenia</li>\r\n 	<li>niewydolność krążenia</li>\r\n 	<li>stany wyniszczenia czynna gruźlica płuc</li>\r\n 	<li>zaawansowana miażdżyca obwodowa</li>\r\n 	<li>zmiany żylno-chłonne</li>\r\n 	<li>zakrzepowa choroba żył kończyn dolnych</li>\r\n 	<li>stany bakteryjne skóry i tkanek miękkichkrwawienia</li>\r\n 	<li>przerwana ciągłość naskórka</li>\r\n 	<li>implanty metalowe w okolicach zabiegowych</li>\r\n 	<li>rozruszniki serca, zastawka</li>\r\n</ul>', 'Liposukcja ultradźwiękowa', '', 'publish', 'closed', 'closed', '', 'liposukcja-ultradzwiekowa', '', '', '2018-02-06 14:24:23', '2018-02-06 13:24:23', '', 984, 'http://192.168.1.42/beauty/?page_id=1174', 0, 'page', '', 0),
