(1181, 1, '2018-02-06 14:32:33', '2018-02-06 13:32:33', '<strong>Masaż bańką chińską</strong> działa niczym drenaż limfatyczny. Poprawia krążenie krwi, przyspiesza metabolizm i usuwa nadmiar toksycznych substancji. Dzięki temu możliwe jest przyspieszenie procesów spalania tkanki tłuszczowej i widoczna redukcja cellulitu. Komórki stają się znacznie lepiej odżywione, co jest efektem zwiększenia przepływu substancji odżywczych. Mniejsze stają się też obrzęki, dzięki poprawie krążenia i działania układu limfatycznego.\r\n\r\n<strong>Przeciwwskazania:</strong>\r\n<ul>\r\n 	<li>Ciąża</li>\r\n 	<li>Miesiączka</li>\r\n 	<li>Żylaki i skłonność do pękających naczynek</li>\r\n 	<li>Stany zapalne skóry</li>\r\n 	<li>Gorączka</li>\r\n</ul>', 'Masaż bańką chińską', '', 'publish', 'closed', 'closed', '', 'masaz-banka-chinska', '', '', '2018-02-06 14:32:33', '2018-02-06 13:32:33', '', 984, 'http://192.168.1.42/beauty/?page_id=1181', 0, 'page', '', 0),
