(1184, 1, '2018-02-06 14:36:31', '2018-02-06 13:36:31', 'Depilacja laserowa (fotoepilacja) służy trwałemu usunięciu owłosienia. Metoda ta polega na uszkodzeniu macierzy włosa przez światło lasera, które jest absorbowane przez melaninę znajdującą się w cebulce włosa będącego w fazie wzrostu.\r\n\r\nPrzygotowanie do zabiegu:\r\n<ul>\r\n 	<li>podczas zabiegu włoski powinny mieć długość 2-3 milimetry</li>\r\n 	<li>przed zabiegiem nie należy wyrywać włosków depilatorem, woskiem, pęsetą</li>\r\n 	<li>najczęściej występującym przeciwwskazaniem jest opalenizna na skórze (słońce, solarium, samoopalacze) - należy odczekać wówczas około 4-6 tygodni, aby skóra zjaśniała</li>\r\n</ul>\r\n<strong>Przeciwwskazania:</strong>\r\n<ul>\r\n 	<li>ciąża (cały okres), karmienie piersią (pierwsze 3 miesiące)</li>\r\n 	<li>opalenizna - powstała na skutek słońca, solarium, samoopalacza (min. 4-6 tygodni)</li>\r\n 	<li>stosowanie kremu z: retinolem (miesiąc przed zabiegiem), witaminami C, A, E lub kwasami owocowymi (należy zaprzestać stosowania na tydzień przed zabiegiem)</li>\r\n 	<li>zażywanie witamin A lub E oraz beta karotenu - należy zaprzestać na tydzień przed zabiegiem</li>\r\n 	<li>leki rozrzedzające krew np.: Aspiryna, Fervex, Gripex - należy zaprzestać stosowania do 48 godzin przed zabiegiem, heparyna - 2 tygodnie przed zabiegiem</li>\r\n 	<li>antybiotyki - nie stosować do 14 dni przed zabiegiem</li>\r\n 	<li>antybiotyki dermatologiczne: Tetracyklina lub Roaccutane (leki na trądzik) - przerwa miedzy ostatnią dawką, a zabiegiem powinna wynieść ok. 6 miesięcy</li>\r\n 	<li>przyjmowanie ziół światłouczulających (dziurawiec, nagietek, bratek) należy nie stosować do 7 dni przed zabiegiem</li>\r\n 	<li>obecność zmian barwnikowych, przerośnięte pieprzyki</li>\r\n 	<li>bielactwo, łuszczyca, skłonności do bliznowacenia</li>\r\n 	<li>cukrzyca - głównie przy zaburzeniach odczucia bólu</li>\r\n 	<li>choroby nowotworowe</li>\r\n 	<li>epilepsja (padaczka)</li>\r\n 	<li>nadciśnienie nieleczone lub nieunormowane</li>\r\n</ul>', 'Fotoepilacja', '', 'publish', 'closed', 'closed', '', 'fotoepilacja', '', '', '2018-02-06 14:36:31', '2018-02-06 13:36:31', '', 984, 'http://192.168.1.42/beauty/?page_id=1184', 0, 'page', '', 0),
